import React from "react";
import {Paper,Grid,withStyles} from "@material-ui/core";
const styles = theme => ({ 
    paper:{
        margin:theme.spacing(2),
        padding:theme.spacing(2)
    },
    root:{
        '& .MuiTextField-root':{
            margin: theme.spacing(1),
            minWidth:230
        }
    },
    formControl:{
        margin: theme.spacing(1),
        minWidth:230
    },
    button:{
        margin: theme.spacing(1)
    }
})
const Home=(classes) =>{
    return (
    <Paper className={classes.paper} elevation={0}>
        <Grid container>
            <Grid item xs={8}>
                <img class="img-fluid rounded mb-4 mb-lg-0" src="http://via.placeholder.com/640x360"></img>
            </Grid>
            <Grid item xs={4}>

            </Grid>
        </Grid>
    </Paper>
    );
}

export default withStyles(styles)(Home);
